import React from 'react';
import './Developers.css';
import foto from '../../images/earth.gif';
import videoDevelopers from '../../video/video_developers.mp4';
import { useEffect } from 'react';


class Person extends React.Component {
    render(){
        return (
        <div className="developers-person-container">
            <div className="developers-person-sectionOne">
                <div className="card-teamDev"><img src={foto} className="dev-placeimg"></img></div>
                <ul>
                    <il>
                        <h4>{this.props.name}</h4>
                    </il>
                </ul>
                <div>{this.props.title}</div>
            </div>
            <div>
                <p className="title">{this.props.title}</p>
                <p>Some text that describes me lorem ipsum ipsum lorem.</p>
                <p>example@example.com</p>
            </div>
        </div>     
    )}
}



export default function Developers() {

    useEffect(() => {
        window.scrollTo(0, 0)
    }, [])

    return (

        <>
            <video className='videoTag' autoPlay loop muted>
                <source src={videoDevelopers} type='video/mp4' />
            </video>
            <div className="dev-intro">
                <h2 className="dev-intro-title"> Our Developers </h2>
                <h6 className="dev-intro-links"> Video by Pavel Danilyuk from Pexels</h6>
            </div>
            <div className="dev-column">
                <Person name="Aleksandr Molchagin" title="founder"></Person>
                <Person name="Revaz Bakuradze" title="founder"></Person>
            </div>
            <div className="dev-column">
                <Person name="David Xu" title="founder"></Person>
                <Person name="Fatima Ortega" title="founder"></Person>
            </div>
        </>

    )

}
